import React, {Component, Image} from 'react';
import ContactInfo from './ContactInfo.js'
import {Container, Row, Col} from 'react-bootstrap';
import {faAt, faEnvelope, faPhone} from '@fortawesome/free-solid-svg-icons';
import {faGit, faInternetExplorer, faLinkedin, faTwitter} from "@fortawesome/free-brands-svg-icons"
import photo from "./../images/gooby.jpg"
import './App.css';


class Header extends Component {

    render(){
        return (
            <div>
                    <h1 className="Title">MIKHAIL GORBACHEV</h1>
                    <p className="Tagline">It's not garbage, it's gorbachev baby</p>
                <Row>
                    <ContactInfo icon={faAt} contact="mikkyTheCommieSlayer69@yahoo.com" />
                    <ContactInfo icon={faPhone} contact="22 244 4222" />
                    <ContactInfo icon={faEnvelope} contact="1900 Colonel Sanders Ln, Louisville, KY" />
                    <ContactInfo icon={faTwitter} contact="@bannedChairman420"/>
                    <ContactInfo icon={faInternetExplorer} contact={<a href="https://www.gorby.ru">https://www.gorby.ru</a>} />
                    <ContactInfo icon={faGit} contact={"lenninEnjoyer"} />
                    <ContactInfo icon={faLinkedin} contact={"bestChairmanEU"} />
                    <img src="./../images/gooby.jpg" />
                </Row>
            </div>
        )
    }

} export default Header
